44c\u0442\u0444\u0438\u043b\u044c\u043c\u043e\u0432, \u043c\u0430\u0442\u0440\u043e\u0441\u0430 \u043f\u043e \u0438\u043c\u0435\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D1%8F%D1%87%D0%BE%D0%BA_%D0%9F%D0%BE%D0%BF%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041c\u043e\u0440\u044f\u0447\u043e\u043a \u041f\u043e\u043f\u0430\u0439\">\u041f\u043e\u043f\u0430\u0439<\/a>, \u0441\u0438\u043b\u044b \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0443\u0434\u0435\u0441\u044f\u0442\u0435\u0440\u044f\u043b\u0438\u0441\u044c \u043f\u043e\u0441\u043b\u0435 \u0441\u044a\u0435\u0434\u0435\u043d\u043d\u043e\u0433\u043e \u0448\u043f\u0438\u043d\u0430\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930\" class=\"mw-redirect\" title=\"1930\">1930<\/a>&#160;\u2014 \u041d\u0430 \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0432\u0448\u0435\u043c \u0441 1 \u043f\u043e 5 \u0438\u044e\u043b\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%B3%D1%80%D0%B0%D0%B4\" title=\"\u0411\u0435\u043b\u0433\u0440\u0430\u0434\">\u0411\u0435\u043b\u0433\u0440\u0430\u0434\u0435<\/a> \u0441\u044a\u0435\u0437\u0434\u0435 \u044d\u043c\u0438\u0433\u0440\u0430\u043d\u0442\u0441\u043a\u0438\u0445 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u043d\u044b\u0445 \u0433\u0440\u0443\u043f\u043f \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0421\u043e\u044e\u0437 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u0438 \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0441 \u0433\u0435\u0440\u0446\u043e\u0433\u043e\u043c \u0421.&#160;\u041d.&#160;\u041b\u0435\u0439\u0445\u0442\u0435\u043d\u0431\u0435\u0440\u0433\u0441\u043a\u0438\u043c. \u0412 \u043f\u043e\u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435 \u0433\u043e\u0434\u0430 \u043d\u0430\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043c\u0435\u043d\u044f\u043b\u043e\u0441\u044c \u043d\u0430 \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0421\u043e\u044e\u0437 \u043d\u043e\u0432\u043e\u0433\u043e \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u044f, \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e-\u0442\u0440\u0443\u0434\u043e\u0432\u043e\u0439 \u0441\u043e\u044e\u0437 \u043d\u043e\u0432\u043e\u0433\u043e \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u044f. \u041d\u044b\u043d\u0435 \u043e\u043d\u0430 \u043d\u043e\u0441\u0438\u0442 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE-%D0%A2%D1%80%D1%83%D0%B4%D0%BE%D0%B2%D0%BE%D0%B9_%D0%A1%D0%BE%D1%8E%D0%B7\" class=\"mw-redirect\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e-\u0422\u0440\u0443\u0434\u043e\u0432\u043e\u0439 \u0421\u043e\u044e\u0437\">\u041d\u0430\u0440\u043e\u0434\u043d\u043e-\u0442\u0440\u0443\u0434\u043e\u0432\u043e\u0439 \u0441\u043e\u044e\u0437 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u0441\u043e\u043b\u0438\u0434\u0430\u0440\u0438\u0441\u0442\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1931\" class=\"mw-redirect\" title=\"1931\">1931<\/a>&#160;\u2014 \u041d\u0430 \u044e\u0433\u0435 \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0430 \u043e\u0442\u043a\u0440\u044b\u0442\u0430 \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430 \u0411\u0435\u043d\u0433\u0443\u044d\u043b\u043b\u0430-\u041a\u0430\u0442\u0430\u043d\u0433\u0430, \u044f\u0432\u043b\u044f\u044e\u0449\u0430\u044f\u0441\u044f \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u043c \u0443\u0447\u0430\u0441\u0442\u043a\u043e\u043c \u043f\u0435\u0440\u04